/*Table structure for table `generic_code` */

DROP TABLE IF EXISTS `generic_code`;

CREATE TABLE `generic_code` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `code_type_id` int(11) DEFAULT NULL,
  `generic_code_id` int(11) DEFAULT NULL,
  `code` varchar(100) CHARACTER SET utf8 NOT NULL,
  `description` varchar(3000) DEFAULT NULL,
  `remarks` varchar(700) DEFAULT NULL,
  `enabled` tinyint(1) DEFAULT NULL,
  `field1` text,
  `field2` varchar(200) DEFAULT NULL,
  `field3` varchar(200) DEFAULT NULL,
  `field4` varchar(200) DEFAULT NULL,
  `field5` varchar(200) DEFAULT NULL,
  `file_id` int(11) DEFAULT NULL,
  `field6` varchar(200) DEFAULT NULL,
  `defaults` tinyint(1) DEFAULT NULL,
  `index` int(5) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `type_code_unique` (`code_type_id`,`code`),
  KEY `FK_generic_code_type` (`code_type_id`),
  KEY `generic_code_field5` (`field5`),
  KEY `generic_code_description` (`description`(767)),
  KEY `FK_generic_code_file` (`file_id`),
  KEY `FK_generic_code` (`generic_code_id`),
  CONSTRAINT `FK__generic_code__code_type` FOREIGN KEY (`code_type_id`) REFERENCES `code_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_generic_code` FOREIGN KEY (`generic_code_id`) REFERENCES `generic_code` (`id`) ON DELETE SET NULL
